package res

import (
	"bytes"
	"encoding/base64"
	"image"
	"image/png"
	"log"
)

func base64ToImage(base64Str string) image.Image {
	imgData, err := base64.StdEncoding.DecodeString(base64Str)
	if err != nil {
		log.Fatal(err)
	}
	imgReader := bytes.NewReader(imgData)
	img, err := png.Decode(imgReader)
	if err != nil {
		log.Fatal(err)
	}
	return img
}

